DROP TABLE places;

CREATE TABLE places(
   name               VARCHAR(93) NOT NULL PRIMARY KEY
  ,address            VARCHAR(135) NOT NULL
  ,telephone          VARCHAR(134) NOT NULL
  ,website            VARCHAR(235)
  ,category           VARCHAR(30)
  ,sub_category       NUMERIC(3,1)
  ,rating             VARCHAR(7) NOT NULL
  ,reviews            VARCHAR(8)
  ,search_keyword     VARCHAR(25)
  ,search_location    VARCHAR(25) NOT NULL
  ,claimed            VARCHAR(10)
  ,permanently_closed VARCHAR(126)
  ,latitude           VARCHAR(154)
  ,longitude          VARCHAR(241)
  ,map_link           VARCHAR(301)
  ,image_url          VARCHAR(80)
  ,title              VARCHAR(93) NOT NULL
  ,title_url          VARCHAR(881) NOT NULL
  ,description        VARCHAR(1313)
  ,opening_hours      VARCHAR(51)
);
